    false,nt"url": null,nt"notes": "The NOAA Seamless Raster Chart Server provides
    a seamless collarless mosaic of the NOAA Raster Navigational Charts (RNC). The RNC
    are a collection of approximately 2,100 charts and inset maps at varying scales
    and resolutions. Full information on the NOAA RNCs can be found here: http://www.nauticalcharts.noaa.gov/mcd/Raster/.
    The Seamless Raster Chart Server integrates all charts in a single map service and
    clips the charts to the extent of the chart, removing the map collar. The set of
    charts displayed automatically change based on the viewer's scale to provide the
    most useful chart scale within the view. The charts in the Seamless Raster Chart
    Server are updated once every month at the beginning of the month to provide the
    latest Notice to Mariners updates.",nt"license_title": null,nt"extras":
